import numpy as np

def lcs(s1, s2, end1, end2):
    if(end1 < 0 or end2 < 0):
        return 0
    tmp = 0
    if(s1[end1] == s2[end2]):
        tmp = 1 + lcs(s1, s2, end1 - 1, end2 - 1)
        print(s1[end1], end=' ')
    return max(tmp, lcs(s1, s2, end1 - 1, end2), 
                lcs(s1, s2, end1, end2 - 1))
                
def lcs2(s1, s2):
    #for runtime improvement, change matrix from list to dict #gives memory error
    matrix = [[0]*(len(s1)+1) for _ in range(len(s2)+1)]
    for x in range(len(s1)):
        for y in range(len(s2)):
            if(s1[x] == s2[y]):
                matrix[x+1][y+1] = 1 + matrix[x][y]
            else:
                matrix[x+1][y+1] = max(matrix[x][y+1], matrix[x+1][y], matrix[x][y])
    #print(np.matrix(matrix), "\n")
    return max(max(matrix))
    
def lcs3(s1, s2):
    curMax = 0
    prevRow = [[0]*(len(s1)+1)]
    for x in range(len(s1)):
        col = [0]
        for y in range(len(s2)):
            if(s1[x] == s2[y]):
                col.append(1 + prevRow[y])
            else:
                col.append(max(prevRow[y+1], col[y], prevRow[y]))
        prevRow = col
    #print(np.matrix(matrix), "\n")
    return max(max(matrix))

